import "./SingIn.scss"

const SingIn = ({active, setActive}) => {
    return (
        <div className={active ? "WrapSingIn active" : "WrapSingIn" } onClick={() => setActive(false)}>
            <div className="SingInInner" onClick={e => e.stopPropagation()}>

            </div>
        </div>
    )
}

export default SingIn;
